export const userColumns = [
    {field: "name", headerName: "NAME", width: 70},
    {
        field: "publisher",
        headerName: "Publisher",
        width: 230,
        renderCell: (params) => {
            return (
                <div className="cellwithPublisher">
                    <img className="cellPublisher" src={params.row.publisher} alt="avatar" />
                    {params.row.platform}
                </div>
            )
        }
    }
]

export const userRows = [
    {name}
]
